import { NeuCard } from "neumorphic-ui";
class Example extends React.Component {
  render() {
    return (
      <div style={{ width: "100%", height: "100%" }}>
        <NeuCard width="350px" height="320px">
          ...Child components
        </NeuCard>
      </div>
    );
  }
}

export default Example;
